import React from 'react'
import {NavLink} from "react-router-dom";
import {FitnessCenter} from "@material-ui/icons";



const Navbar =()=> {

    return (
       <div className='styles.Navbar'>
           <NavLink to='/' >{FitnessCenter}</NavLink>
       </div>
    )
}

export default Navbar
